import React from "react";
import { useNavigate } from "react-router-dom";
import "./HomePage.css";

const HomePage = () => {
  const navigate = useNavigate();

  const handleNavigateToLandingPage = () => {
    navigate("/landing"); // Replace "/landing" with the actual route for your Landing Page
  };

  return (
    <div className="homepage">

      {/* Hero Section */}
      <div className="hero-section">
        <div className="hero-content">
          <h1>
          Empowering Students and Professors with{" "}
            <span className="highlight">Smarter, AI-Driven Dashboards using</span> with
            DeepCanvas.
          </h1>
          <p>
          Our platform leverages AI to streamline education dashboards, making them more intuitive and efficient.
          Automating grading insights, real-time analytics, and tools to enhance classroom engagement.
          </p>
          <button className="navigate-button" onClick={handleNavigateToLandingPage}>
            start
          </button>
        </div>
        <div className="hero-graphic">
          <div className="graphic-box graphic-box-green"></div>
          <div className="graphic-box graphic-box-purple"></div>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
